/*
 * This functions parses a quoted string and accepts
 * escaped quotes (e.g., "hello \"world\"") within strings.
 */
static ATerm mkstring()
{
   ATerm theString;
   char* buf = NULL;
   int c;
   int size = 512;
   int ind  = 0;
   
   /* use dynamically resizable buffer to store string */
   buf = resize_buf( buf, size );

   /* add opening quote */
   CHECK( buf, size, ind );
   buf[ind++] = '"';

   while( 1 )
   {
      c = input();

      if( c == '\"' )
         break;

      if( c <= 0 )
      {
         yyerror( "String not terminated at eof" );
         return NULL;
      }
      
      /* Handle escaped character */
      if( c == '\\' )
      {
         CHECK( buf, size, ind );
         buf[ind++] = c;
         c = input();
      }

      CHECK( buf, size, ind );
      buf[ind++] = c;
   }
   /* Add closing quote */
   CHECK( buf, size, ind );
   buf[ind++] = '"';

   /* terminate string */
   buf[ind] = '\0';

   /* convert to aterm */
   theString = ATparse( buf );

   /* free buffer */
   free( buf );
   
   /* return quotes string */
   return theString;
}
